TV Salvador was a Brazilian television station based in Salvador, capital of the state of Bahia. It operated on UHF channels 28 and 36 on NET and was owned by Rede Bahia.


== History ==
TV Salvador was opened on December 31, 2000, with an independent and completely local schedule. The station broadcast live the Summer Festival, promoted by IContent, a company that is also part of Rede Bahia, in addition to showing programs from TV Bahia, such as Na Carona, which was shown on the station at 4:50 pm and 22:15, Aprovado, Bahia Meio Dia, Globo Esporte Bahia, Bahia Rural and Rede Bahia Revista, also opening space for programs made by stations from Rede Bahia de Televisão such as Canal Aberto, from TV Subaé, Encontro Com, from TV Santa Cruz, Somos Nós, from TV Sudoeste and Tema, from TV São Francisco, in addition to showing local blocks of news programs from all inland stations in the interior. In December 2002, an agreement was signed with the Portuguese version of GNT to show some of its productions, mainly musical and cultural offerings and some programs related to Carnaval, in addition to two concerts by Daniela Mercury. TV Salvador's terrestrial signal was limited exclusively to the metropolitan area of Salvador, reaching an audience of just over 750,000 potential households in 2002; The cable signal, reaching just over 46,000 households, in addition to being captured in Salvador, was also captured in other cities covered by NET Salvador, in Vitória da Conquista and Itabuna.
On January 19, 2004, the station changed from channel 38 to channel 36 on NET.
In 2012, the sale of the station by Rede Bahia to an evangelical business group was confirmed. 19 programs started to be broadcast on the Rede Brasil retransmitter, on channel 51. On March 5, 2013, the station officially ended its programming, after the sale was completed.


